  };
  return (
    <React.Fragment>
      <Wrap>
        <SmallWrap>
          <CheckWhether id="editor" />
          <div id="editor">트레블 에디터</div>
          <Question />
        </SmallWrap>

        <SmallWrap>
          <CheckWhether />
          <div>트레블러</div>
          <Question />
        </SmallWrap>
      </Wrap>
    </React.Fragment>
  );
};

export default Role;

const Wrap = styled.div`
  width: 23rem;
  height: auto;
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  margin: 0px auto;
  margin-bottom: 1rem;
`;

const SmallWrap = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`;

const CheckWhether = styled.div`
  cursor: pointer;
  width: 1.3rem;
  height: 1.3rem;
  background-image: url("${blankcheck}");
  background-size: 1.3rem 1.3rem;
  margin-right: 0.5rem;
`;

const Question = styled.div`
  cursor: pointer;
  width: 0.8rem;
  height: 0.8rem;
  background-image: url("${question}");
  background-size: 0.8rem 0.8rem;
  margin: 0px auto;
  margin-left: 1rem;
`;
